import Card from './Card';

const CardList = ({robots}) => {
  return (
    <div>
      {robots.map((robot) => (
          <div key={robot.id}>
            <Card 
              id={robot.id}
              name={robot.name}
              username={robot.username}
              email={robot.email}
            />
          </div>
        ))}
    </div>
  )
}

export default CardList
